import React, { useEffect, useState } from "react";

export default function Header() {

  return (
    <div
      style={{
        width: "100%",
        padding: "15px 40px",
        background: "linear-gradient(90deg, #f0f4ff, #e6f0ff)",
        alignItems: "center",
        justifyContent: "center",
        boxShadow: "0 2px 6px rgba(0,0,0,0.1)",
      }}
    >
      {/* Logo */}
      <img
        src="/dataTrail.png" // public folder path
        alt="DataTrail Logo"
        style={{ width: 50, height: 50, marginRight: 15, borderRadius: 8 }}
      />

      {/* App name */}
      <span
        style={{
          fontSize: "36px",
          fontWeight: "bold",
          color: "rgba(0,0,0,0.1)",
          fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
          transition: "color 0.5s ease",
        }}
      >
        <img
        src="/dataTrail.png" // public folder path
        alt="DataTrail Logo"
        style={{ width: 100, height: 50, marginRight: 15, borderRadius: 8 }}
      />
      </span>
    </div>
  );
}
